/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `parcela_status_cliente` */$$

/*!50003 CREATE */ /*!50017 DEFINER = 'root'@'localhost' */ /*!50003 TRIGGER `parcela_status_cliente` AFTER UPDATE ON `parcela` FOR EACH ROW BEGIN
DECLARE clienteId INT;
DECLARE diasAtraso INT;
	SELECT DATEDIFF(CURRENT_DATE(), `dataVencimento`) FROM `parcela` WHERE `mensalidade_id` = old.mensalidade_id AND `situacao` = FALSE LIMIT 1 
	INTO diasAtraso;
	
	-- ATUALIZAR TABELA CLIENTE COM STATUS BLOQUEADO
	IF (diasAtraso >= 15) THEN 
	
	    SELECT `cliente_id` FROM `mensalidade` WHERE `id` = old.mensalidade_id LIMIT 1 INTO clienteId;
	    UPDATE `cliente` SET `status` = 'BLOQUEADO' where `id` = clienteId;
	
	END IF;		
	
	-- ATUALIZAR TABELA CLIENTE COM STATUS DESATIVADO
	IF (diasAtraso >= 90) THEN 
		SELECT `cliente_id` FROM `mensalidade` WHERE `id` = old.mensalidade_id LIMIT 1 INTO clienteId;
		UPDATE `cliente` SET `status` = 'DESATIVADO', dataDesativacao = CURRENT_DATE() WHERE `id` = clienteId;			
		 -- SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'está  a 30 dias atrasada';
	END IF;		
	
	if (diasAtraso < 15 && diasAtraso < 90) then 
	    SELECT `cliente_id` FROM `mensalidade` WHERE `id` = old.mensalidade_id LIMIT 1 INTO clienteId;
	    UPDATE `cliente` SET `status` = 'ATIVO', dataDesativacao = NULL WHERE `id` = clienteId;
	end if;
	
END */$$


